import React from 'react';
import Keyboard from './Keyboard';
import Board from './Containers/Board';

function Sudoku(){

    const board = [];
    for(var i=0; i<9; i++) {
        board[i] = [];
        for(var j=0; j<9; j++) {
            board[i][j] = undefined;
        }
    };



    return (
        <>
            <div style={{ display: "grid", gridTemplateColumns: "repeat(2, 1fr)", gridGap: 20,  }}>
                <div>
                    <Board />
                </div>
                <div>
                    <Keyboard/>
                </div>
            </div>
        </>
    )
}

export default Sudoku;
